import React from "react";


function Footer(){

    let footerStyle = {
        background: '#363636',
        marginTop: '6em',
        textAlign: 'center',
        color: 'white',
        minHeight: '10vh',
        width: '100vw'
        
        
    }

    return(
    <div style = {footerStyle} className="container" id = "footer">
        <h3 style = {{paddingTop: '0.5em'} }>By Kavish Tomar</h3>
    </div>
    );

}

export default Footer;
